@@ -0,0 +1,54 @@
+const messages = [
+  {
+    id: 1,
+    message: 'Hello',
+    sender: 'user',
+  },
+  {
+    id: 2,
+    message: 'Hi',
+    sender: 'bot',
+  },
+  {
+    id: 3,
+    message: 'How are you?',
+    sender: 'user',
+  },
+  {
+    id: 4,
+    message: 'I am fine',
+    sender: 'bot',
+  },
+];
+
+const Chat = () => {
+  return (
+    <div className='flex flex-col p-2'>
+      <div className='font-bold text-xl'>Chat</div>
+      <div className='flex flex-col flex-grow'>
+        {messages.map((message) => {
+          return (
+            <div
+              key={message.id}
+              className={`flex ${
+                message.sender === 'user' ? 'flex-row-reverse' : ''
+              }`}
+            >
+              <div
+                className={`p-2 m-2 border border-black ${
+                  message.sender === 'user' ? 'bg-blue-200' : 'bg-gray-200'
+                }`}
+              >
+                {message.message}
+              </div>
+            </div>
+          );
+        })}
+      </div>
+    </div>
+  );
+};
+
+export default Chat;
+
+

